const perm = new Array(512);
const gradP = new Array(512);

function fade(t) {
  return t * t * t * (t * (t * 6 - 15) + 10);
}

function lerp(a, b, t) {
  return (1 - t) * a + t * b;
}

// 2D Perlin Noise
function perlin(x, y, seed = 0) {
  if (seed > 0 && seed < 1) {
    // Scale the seed out
    seed *= 65536;
  }

  seed = Math.floor(seed);
  if (seed < 256) {
    seed |= seed << 8;
  }

  for (let i = 0; i < 256; i++) {
    let v;
    if (i & 1) {
      v = p[i] ^ (seed & 255);
    } else {
      v = p[i] ^ ((seed >> 8) & 255);
    }

    perm[i] = perm[i + 256] = v;
    gradP[i] = gradP[i + 256] = grad3[v % 12];
  }

  // Find unit grid cell containing point
  let X = Math.floor(x),
    Y = Math.floor(y);
  // Get relative xy coordinates of point within that cell
  x -= X;
  y -= Y;
  // Wrap the integer cells at 255 (smaller integer period can be introduced here)
  X &= 255;
  Y &= 255;

  // Calculate noise contributions from each of the four corners
  const n00 = gradP[X + perm[Y]].dot2(x, y);
  const n01 = gradP[X + perm[Y + 1]].dot2(x, y - 1);
  const n10 = gradP[X + 1 + perm[Y]].dot2(x - 1, y);
  const n11 = gradP[X + 1 + perm[Y + 1]].dot2(x - 1, y - 1);

  // Compute the fade curve value for x
  const u = fade(x);

  // Interpolate the four results
  return lerp(lerp(n00, n10, u), lerp(n01, n11, u), fade(y));
}

export default class Liquid3D extends Component {
  state = {
    fps: 30,
    sensitivity: 20,
    mouseBeta: 1,
    mouseGamma: 0.1,
    initialRotation: {
      x: -0.3,
      y: -0.45,
    },
  };

  size = {
    width: 320,
    height: 600,
  };

  vertices = [];
  mousePosition = {};
  deviceOrientation = { beta: 0, gamma: 0 };

  componentDidMount() {
    this.lastRender = new Date();
    this.isTouch = 'ontouchstart' in window;
    window.addEventListener('resize', this.adjustSize);
    window.addEventListener('mousemove', this.getMousePosition);
    window.addEventListener('deviceorientation', this.getDeviceOrientation);
    this.init();
  }

  updateOrientation = () => {
    if (this.isTouch) {
      const { beta, gamma } = this.deviceOrientation;

      const normalizedBeta = Math.sin(
        (beta + BETA_OFFSET_DEGREES) * DEGREES_TO_RADIANS,
      );
      const gammaClamp = 1 - Math.abs(normalizedBeta); // reduce gamma authority as it becomes unstable near 90deg

      const normalizedGamma =
        gammaClamp * Math.sin(2 * gamma * DEGREES_TO_RADIANS);

      return { beta: normalizedBeta, gamma: normalizedGamma };
    }

    const { x, y } = this.mousePosition;
    const { width, height } = this.size;

    if (!x || !y) {
      return { beta: 0, gamma: 0 };
    }

    const adjustedX = 2 * (x / width) - 1;
    const adjustedY = 1 - 2 * (y / height);
    this.raycaster.setFromCamera(
      new THREE.Vector2(adjustedX, adjustedY),
      this.camera,
    );
    const intersects = this.raycaster.intersectObjects([this.intersectPlane]);
    const { sensitivity, mouseBeta, mouseGamma } = this.state;

    if (intersects.length === 0) {
      return { beta: 0, gamma: 0 };
    }

    const intersect = intersects[0];
    const distanceX = intersect.point.x;
    const distanceY = intersect.point.y;
    const ax = -distanceX / sensitivity;
    const ay = distanceY / sensitivity;
    const beta = ay * mouseBeta * 2;
    const gamma = ax * mouseGamma * -20;

    return { beta, gamma };
  };

  updateObjects() {
    const { beta, gamma } = this.updateOrientation();

    if (this.renderedObject) {
      this.renderedObject.rotation.y = this.state.initialRotation.x + gamma;
      this.renderedObject.rotation.x = this.state.initialRotation.y + beta;
    }

    if (this.vertices) {
      this.vertices.forEach((vertex, i) => {
        const speed = 0.001;
        const time = this.props.time;
        const frequency = 1;
        const amplitude = 0.05 + this.props.high * 0.4;
        const phase = vertex.originalPosition.x * 3.5 - time * speed;

        const sineWave =
          amplitude * Math.sin(2 * Math.PI * frequency * time + phase);
        const noise = vertex.noiseValue * 0.3;

        this.renderedObject.geometry.vertices[i].z = sineWave + noise;
      });

      const noiseScale = this.props.low * 0.25;
      this.renderedObject.material.normalScale = new THREE.Vector3(noiseScale);

      this.renderedObject.geometry.verticesNeedUpdate = true;
      this.renderedObject.geometry.normalsNeedUpdate = true;
      this.renderedObject.geometry.computeVertexNormals();
      this.renderedObject.geometry.__dirtyVertices = true;
    }
  }

  init() {
    this.start = Date.now();
    this.initRenderer();
    this.initScene();
    this.initCamera();

    if (!this.isTouch) {
      this.initMouseGyro();
    }

    this.initEnvMapPlane();
    this.initLights();
    this.adjustSize();
  }

  initRenderer() {
    const { width, height } = this.size;

    const renderer = new THREE.WebGLRenderer({
      alpha: true,
      logarithmicDepthBuffer: true,
      autoClear: true,
    });

    renderer.sortObjects = false;
    renderer.setPixelRatio(window.devicePixelRatio);
    renderer.setClearColor(LYRICS_COLORS.pink, 0);
    renderer.setSize(width, height);
    renderer.gammaInput = true;
    renderer.gammaOutput = true;
    renderer.context.getShaderInfoLog = function() {
      return '';
    }; // Surpress warnings from Safari GLSL bug https://github.com/mrdoob/three.js/issues/9716

    this.renderer = renderer;
    this.el.appendChild(this.renderer.domElement);
  }

  initScene() {
    this.scene = new THREE.Scene();
  }

  initCamera() {
    const { width, height } = this.size;
    const camera = new THREE.PerspectiveCamera(45, width / height);
    camera.position.set(0, 0, -4);
    camera.lookAt(new THREE.Vector3(0, 0, 0));
    this.scene.add(camera);
    this.camera = camera;
  }

  initLights() {
    // Lights must be spots to interact with environment maps

    const leftSpotLight = new THREE.SpotLight(LYRICS_COLORS.blue, 1);
    leftSpotLight.position.set(-4, -3, -6);
    leftSpotLight.target = this.renderedObject;

    const rightSpotLight = new THREE.SpotLight(COLORS.white, 1);
    rightSpotLight.position.set(4, -3, -6);
    rightSpotLight.target = this.renderedObject;

    this.scene.add(leftSpotLight);
    this.scene.add(rightSpotLight);
  }

  initEnvMapPlane() {
    const urls = [POSZ, POSZ, NEGZ, POSZ, NEGZ, NEGZ];

    this.reflectionCube = new THREE.CubeTextureLoader().load(urls);
    this.reflectionCube.format = THREE.RGBFormat;
    this.reflectionCube.mapping = THREE.CubeReflectionMapping;
    this.reflectionCube.wrapS = THREE.ClampToEdgeWrapping;
    this.reflectionCube.wrapT = THREE.ClampToEdgeWrapping;
    this.reflectionCube.flipY = false;

    const planeWidth = 4;
    const planeHeight = 7;
    const planeRes = 200;

    const planeGeometry = new THREE.PlaneGeometry(
      planeWidth,
      planeHeight,
      planeRes,
    );

    planeGeometry.verticesNeedsUpdate = true;

    planeGeometry.vertices.forEach((vertex, i) => {
      vertex.x = vertex.y > 0 ? vertex.x * (vertex.y * 0.35) : vertex.x;
      const noiseValue = perlin(vertex.y, vertex.x, 0.5);
      this.vertices[i] = {
        position: vertex,
        originalPosition: vertex,
        noiseValue,
      };
    });

    THREE.TextureLoader.prototype.crossOrigin = '';
    const normalTexture = new THREE.TextureLoader().load(NORMAL_NOISE);
    normalTexture.wrapS = THREE.ClampToEdgeWrapping;
    normalTexture.wrapT = THREE.ClampToEdgeWrapping;
    normalTexture.magFilter = THREE.LinearFilter;
    normalTexture.minFilter = THREE.LinearFilter;
    normalTexture.format = THREE.RGBFormat;

    const reflectionMaterial = new THREE.MeshPhongMaterial({
      color: LYRICS_COLORS.pink,
      envMap: this.reflectionCube,
      normalMap: normalTexture,
      normalScale: new THREE.Vector3(0.0, 0.0),
      combine: THREE.MixOperation,
      side: THREE.DoubleSide,
      reflectivity: 0.99,
      shininess: 100,
      specular: LYRICS_COLORS.lightPink,
    });

    const plane = new THREE.Mesh(planeGeometry, reflectionMaterial);

    this.renderedObject = plane;

    this.renderedObject.geometry.dynamic = true;

    this.renderedObject.position.set(0, -0.5, 6);
    this.renderedObject.rotation.x = this.state.initialRotation.x;
    this.renderedObject.rotation.y = this.state.initialRotation.y;

    this.scene.add(this.renderedObject);
  }

  initMouseGyro() {
    this.raycaster = new THREE.Raycaster();

    const planeGeometry = new THREE.PlaneGeometry(100, 100, 1);
    const planeMaterial = new THREE.MeshBasicMaterial({
      side: THREE.DoubleSide,
      visible: false,
    });
    this.intersectPlane = new THREE.Mesh(planeGeometry, planeMaterial);
    this.scene.add(this.intersectPlane);
  }

  adjustSize = () => {
    if (this.el && this.renderer && this.camera) {
      const {
        width,
        height,
      } = this.renderer.domElement.getBoundingClientRect();

      this.renderer.setSize(width, height);

      this.camera.aspect = width / height;
      this.camera.updateProjectionMatrix();

      this.size = { width, height };
    }
  };

  getMousePosition = e => {
    this.mousePosition = {
      x: e.clientX,
      y: e.clientY,
    };
  };

  getDeviceOrientation = e => {
    const { absolute, alpha, beta, gamma } = e;
    this.deviceOrientation = {
      absolute,
      alpha,
      beta,
      gamma,
    };
  };

  getFPSInterval() {
    return 1000 / this.state.fps;
  }

  render() {
    const elapsed = this.props.time - this.lastRender;
    const fpsInterval = this.getFPSInterval();
    if (elapsed > fpsInterval) {
      this.lastRender = this.props.time;
      if (this.renderer) {
        this.updateObjects();
        this.renderer.render(this.scene, this.camera);
      }
    }

    return (
      <div
        className="liquid3D"
        ref={el => {
          this.el = el;
        }}
      />
    );
  }
}
